<p><span style="font-size: 14pt;">1) каркас решетки – квадрат 10, материал рисунка – по выбору;</span></p>
<p><span style="font-size: 14pt;">2) размер до 80х70х55см;</span></p>
<p><span style="font-size: 14pt;">3) дверь справа;</span></p>
<p><span style="font-size: 14pt;">4) замок;</span></p>
<p><span style="font-size: 14pt;">5) покраска;</span></p>
<p><span style="font-size: 14pt;">6) установка.</span></p>
<p><span style="font-size: 14pt;">&nbsp;</span></p>
<p><b><span>Дополнительные опции: </span></b></p>
<p><span style="font-size: 14pt;">1) Верх закрытый металлом +500р.</span></p>
<p><span style="font-size: 14pt;">2) Сетка рабица 40 внутри +1300р.</span></p>
<p><span style="font-size: 14pt;">&nbsp;</span></p>
<p><span style="font-size: 14pt;">Также возможно изготовление любой решетки из любых материалов любых размеров, по индивидуальным расчетам.</span></p>";s:9:"showtitle";s:1:"1";s:6:"params";s:138:"{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}";s:6:"menuid";s:3:"477";s:4:"user";i:0;s:4:"name";s:6:"custom";s:5:"style";N;}i:6;O:8:"stdClass":11:{s:2:"id";s:3:"233";s:5:"title";s:35:"Леерные ограждения";s:6:"module";s:11:"mod_sigplus";s:8:"position";s:16:"content-bottom-b";s:7:"content";s:0:"";s:9:"showtitle";s:1:"1";s:6:"params";s:1156:"{"images_folder":"images\\services\\guardleers","layout":"flow","rows":"0","cols":"0","thumb_count":"0","thumb_width":"180","thumb_height":"105","thumb_crop":"0","alignment":"center","lightbox":"boxplus\/darksquare","lightbox_slideshow":"0","slider":"boxplus.slider","slider_orientation":"horizontal","slider_navigation":"both","slider_buttons":"1","slider_links":"1","slider_counter":"0","slider_overlay":"1","slider_duration":"800","slider_animation":"0","captions":"boxplus.caption","caption_title":"\u0412\u043e\u0440\u043e\u0442\u0430","caption_description":"\u0412\u043e\u0440\u043e\u0442\u0430 \u0433\u0430\u0440\u0430\u0436\u043d\u044b\u0435","download":"1","metadata":"0","margin":"","border_style":"","border_width":"","border_color":"","padding":"","thumb_cache":"1","thumb_folder":"thumbs","preview_folder":"preview","fullsize_folder":"fullsize","base_url":"","thumb_quality":"85","labels":"labels","labels_multilingual":"0","sort_criterion":"labels-filename","sort_order":"0","linkage":"inline","ajaxapi":"default","library":"default","moduleclass_sfx":"","debug":"0","settings":"watermark=1 watermark:position=se watermark:x=5 watermark:y=5"}";s:6:"menuid";s:3:"477";s:4:"user";i:0;s:4:"name";s:7:"sigplus";s:5:"style";N;}i:7;O:8:"stdClass":11:{s:2:"id";s:3:"248";s:5:"title";s:44:"Решетки на кондиционеры";s:6:"module";s:11:"mod_sigplus";s:8:"position";s:16:"content-bottom-b";s:7:"content";s:0:"";s:9:"showtitle";s:1:"1";s:6:"params";s:978:"{"images_folder":"images\\content\\price\\reshetki","layout":"flow","rows":"0","cols":"0","thumb_count":"0","thumb_width":"180","thumb_height":"105","thumb_crop":"0","alignment":"center","lightbox":"boxplus\/darksquare","lightbox_slideshow":"0","slider":"boxplus.slider","slider_orientation":"horizontal","slider_navigation":"both","slider_buttons":"1","slider_links":"1","slider_counter":"0","slider_overlay":"1","slider_duration":"800","slider_animation":"0","captions":"boxplus.caption","caption_title":"","caption_description":"","download":"1","metadata":"0","margin":"","border_style":"","border_width":"","border_color":"","padding":"","thumb_cache":"1","thumb_folder":"thumbs","preview_folder":"preview","fullsize_folder":"fullsize","base_url":"","thumb_quality":"85","labels":"labels","labels_multilingual":"0","sort_criterion":"labels-filename","sort_order":"0","linkage":"inline","ajaxapi":"default","library":"default","moduleclass_sfx":"","debug":"0","settings":""}";s:6:"menuid";s:3:"477";s:4:"user";i:0;s:4:"name";s:7:"sigplus";s:5:"style";N;}i:8;O:8:"stdClass":11:{s:2:"id";s:3:"249";s:5:"title";s:12:"Перила";s:6:"module";s:10:"mod_custom";s:8:"position";s:16:"content-bottom-b";s:7:"content";s:2735:"<p style="text-align: center;"><b><span style="font-size: 16pt;">ПРАЙС НА ПЕРИЛА</span></b></p>
<p style="text-align: center;"><b><span style="font-size: 16pt;">&nbsp;</span></b></p>
<p><span style="font-size: 14pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Цены указаны в рублях за погонный метр.</span></p>
<p style="text-indent: 27pt;"><span style="font-size: 14pt;">Столбы не входят в стоимость изготовления перил, так как их количество определяется исходя из длины перил и особенностей места установки.</span></p>
<p style="text-indent: 27pt;"><span style="font-size: 14pt;">&nbsp;</span></p>
<p><span style="font-size: 14pt;">Столбы: профильная труба 40х40 – 100руб./шт.</span></p>
<p><span style="font-size: 14pt;">Шар на столб – 100руб./шт.</span></p>
<p><span style="font-size: 14pt;">Рисунок – квадрат 10</span></p>
<p><span style="font-size: 14pt;">Высота перил 90см.</span></p>
<p><span style="font-size: 14pt;">&nbsp;</span></p>
<p><b><span style="font-size: 14pt;">Варианты поручней (указанные в прайсе):</span></b></p>
<p><span style="font-size: 14pt;">-труба 32х3,2 (39мм. внешний диаметр) </span></p>
<p><span style="font-size: 14pt;">-профильная труба 40х20</span></p>
<p><span style="font-size: 14pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Также возможна установка пластиковых поручней «под дерево» (диаметр 50 мм.), их стоимость рассчитывается индивидуально.</span></p>
<p><span style="font-size: 14pt;">&nbsp;</span></p>
<p><b><span style="font-size: 14pt;">Покраска:</span></b></p>
<p><span style="font-size: 14pt;">Нитроэмаль – 250руб./м.п.</span></p>
<p><span style="font-size: 14pt;">Полимерное покрытие – 500руб./м.п.</span></p>
<p><b><span style="font-size: 14pt;">Доставка </span></b></p>
<p><b><span style="font-size: 14pt;">Монтаж: </span></b><span style="font-size: 14pt;">Обговаривается по месту.</span></p>
<p><span style="font-size: 14pt;">&nbsp;</span></p>
<p style="text-indent: 27pt;"><span style="font-size: 14pt;">Конечная стоимость рассчитывается: </span></p>
<p><span style="font-size: 14pt;">Цена изготовления * метраж перил + столбы + покраска + доставка + монтаж.</span></p>";s:9:"showtitle";s:1:"1";s:6:"params";s:138:"{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}";s:6:"menuid";s:3:"477";s:4:"user";i:0;s:4:"name";s:6:"custom";s:5:"style";N;}i:9;O:8:"stdClass":11:{s:2:"id";s:3:"250";s:5:"title";s:12:"Перила";s:6:"module";s:11:"mod_sigplus";s:8:"position";s:16:"content-bottom-b";s:7:"content";s:0:"";s:9:"showtitle";s:1:"1";s:6:"params";s:976:"{"images_folder":"images\\content\\price\\perila","layout":"flow","rows":"0","cols":"0","thumb_count":"0","thumb_width":"180","thumb_height":"105","thumb_crop":"0","alignment":"center","lightbox":"boxplus\/darksquare","lightbox_slideshow":"0","slider":"boxplus.slider","slider_orientation":"horizontal","slider_navigation":"both","slider_buttons":"1","slider_links":"1","slider_counter":"0","slider_overlay":"1","slider_duration":"800","slider_animation":"0","captions":"boxplus.caption","caption_title":"","caption_description":"","download":"1","metadata":"0","margin":"","border_style":"","border_width":"","border_color":"","padding":"","thumb_cache":"1","thumb_folder":"thumbs","preview_folder":"preview","fullsize_folder":"fullsize","base_url":"","thumb_quality":"85","labels":"labels","labels_multilingual":"0","sort_criterion":"labels-filename","sort_order":"0","linkage":"inline","ajaxapi":"default","library":"default","moduleclass_sfx":"","debug":"0","settings":""}";s:6:"menuid";s:3:"477";s:4:"user";i:0;s:4:"name";s:7:"sigplus";s:5:"style";N;}i:10;O:8:"stdClass":11:{s:2:"id";s:3:"251";s:5:"title";s:12:"Ворота";s:6:"module";s:10:"mod_custom";s:8:"position";s:16:"content-bottom-b";s:7:"content";s:7683:"<p style="text-align: center; text-indent: 36pt;"><b><span style="font-size: 14pt;">ВОРОТА ГАРАЖНЫЕ МЕТАЛЛИЧЕСКИЕ</span></b></p>
<p><span style="font-size: 14pt;">Материал: рама – уголок 63, створки уголок 50, шарниры 40мм; калитка – уголок 40, шарниры 25мм.</span></p>
<p><span style="font-size: 14pt;"><span style="font-size: 14pt;">Схема изготовления каркаса ворот:</span><br /> </span></p>
<p style="text-align: center;"><img class="fb" alt="Без калитки" src="images/content/price/vorota/vorota_1.jpg" height="451" width="600" /><img class="fb" alt="С калиткой" src="images/content/price/vorota/vorota_2.jpg" height="460" width="600" /></p>
<p><span style="font-size: 14pt;">Цены на гаражные ворота, в рублях в зависимости от комплектации.</span></p>
<p><span style="font-size: 14pt;">В стандартную стоимость включено: замок врезной, уши под навесной </span></p>
<p><span style="font-size: 14pt;">замок с защитой и монтаж.</span></p>
<p><span style="font-size: 14pt;">Утепленные ворота: полистирол, внутренняя отделка- оцинкованная сталь 0,55 либо фанерой 9мм.</span><span style="font-size: 14pt;">Сталь оцинкованная 0,7мм., либо фанера 12мм будет стоить дороже на 800руб.</span></p>
<p><span style="font-size: 14pt;">Цены на гаражные ворота, в рублях в зависимости от комплектации.</span></p>
<p style="text-align: center; text-indent: 36pt;"><b><span style="font-size: 18pt;">Размер проёма ворот по прайсу до 2,45х2,45м.</span></b></p>
